import React from "react";
import './hero.css';

function heroSection() {
  return (
    <div className="container">

        <div className="avatar">
            <img src="https://www.gravatar.com/avatar/205e460b479e2e5b48aec07710c08d50" alt="avatar"/>
        </div>

        <div className="hero">
            <h2>Hi, I'm Terry.
              <br>I'm a student graduate from XiDian University </br> 
              <br> and now I'm going to find a formal job or internship.</br>
              <br>Besides, I'm considering to continue with master studies</br> 
             </h2>
            <p>Major: Software Engineer</p>

            <div className="social-links"></div>

        </div>

    </div>
  );
}

export default heroSection;
